             [RS2] EdgeVillage Yew Cutter and banker                   


-----------------------------------------------------------------------

                        by Solemn Wishes                               
                contact: Rune-nation@hotmail.co.uk                    


-----------------------------------------------------------------------

 This script will start at edgevillage bank, walk to the yew tree's   
 and switch between them until your inventory is full, it will then   
                  bank your newly aquired fortune and start again :)                                         

-----------------------------------------------------------------------
                           Instructions.                               
-----------------------------------------------------------------------


1. USE Runescape with low Detail, Very Bright.                      
2. Set your Screen to 32 bit TRUE color.                              
3. Set Playernames, Passwords ect ect ect                            
4. Have pickaxe in first inventory slot or equipted
5. fill in the form
